import React, { useEffect, useState } from 'react'
import { useSelector } from 'react-redux'
import { useDispatch } from 'react-redux'

import { selectDetailsAboutFilm } from 'store/DetailAboutFilm/selectors'
import { loadDetailFilm } from 'store/DetailAboutFilm/actions'
import routeMain from './routes'


import './style.scss'
import { useParams } from 'react-router-dom'

const FilmDetail = () => {
  const {id} = useParams();
  const dispatch = useDispatch();
  const ShowDetail = useSelector(selectDetailsAboutFilm);
  useEffect(() => {
    dispatch(loadDetailFilm(id))
  }, [id, dispatch]);

   return (
     <div>
       {ShowDetail.length > 0 ? (
         ShowDetail.map((detail) => {
           <div>
             <h2>{detail?.name}</h2>
           </div>
           console.log(detail.name)
         })
       ) : <div>Пусто</div>}
     </div>
   )
}

export { routeMain }
export default FilmDetail
